import React from "react";

const Spaces=()=>{
    const [spaces, setSpaces] = React.useState([]);

    React.useEffect(() => {
      fetch("localhost:3001/getspaces")
        .then((res) => res.json())
        .then((data) => setSpaces(data));
    }, []);
    console.log(spaces);
    return(
        <div>

        </div>
    )
   
}
export default Spaces;
